/**
 * @param {number[]} nums
 * @return {number}
 */
var sumFourDivisors = function(nums) {
    let sum = 0;
    const dp = {};
    for (let i = 0; i < nums.length; i++) {
        const divisors = [];
        if (dp[nums[i]]) {
            Array.prototype.push.apply(divisors, dp[nums[i]]);
        } else {
            const sqr = Math.abs(Math.sqrt(nums[i]));
            for (let j = nums[i]; j >= sqr; j--) {
                if (nums[i] % j === 0) {
                    divisors.push(j);
                    const rem = nums[i] / j;
                    if (rem !== j) {
                     divisors.push(rem);
                    }
                }
                if (divisors.length > 4) break;
            }
            dp[nums[i]] = divisors;
        }
        if (divisors.length === 4) {
            sum += divisors[0] + divisors[1] + divisors[2] + divisors[3];
        }
    }

    return sum;
};

